import React from 'react';

export const Profile = () => {
    return (
        <>
            <div className='profile'>
                <img className='photo' 
                src='C://image/1.jpg'
                alt='karina'
                />
                <h1>카리나</h1>
                <p>가수</p>
            </div>
        </>
    )
};
